def find_subsets(m, x, y):
	
	set = start_rec(m, x, y, [])
	
	print(set, len(set))
	
	print(len(list(dict.fromkeys(set))))
	
	plt.matshow(m)
	plt.show()
	
	
def start_rec(m, x, y, way):
	x_max,y_max = m.shape 
	
	if 0 <= x < x_max and 0 <= y < y_max:
		if m[x,y] == 0 and (x,y) not in way:
			way.append((x,y))
			
			way+start_rec(m, x-1, y, way)
			way+start_rec(m, x+1, y, way)
			way+start_rec(m, x, y-1, way)
			way+start_rec(m, x, y+1, way)
			
			return way
	
	return []
	
